import React from 'react'
import Crontab from 'reactjs-crontab'
import 'reactjs-crontab/dist/index.css'
//copy and paste this code and run!



const tasks = []

const App = () => {
    return (
      <Crontab 
        tasks={tasks}
        timeZone='UTC'
        dashboard={{ hidden: false }}
      />
    )
}

export default App
